  //     iptText: "Confidence",
  //     iptId: "iptConfidence",
  //     sldId: "sldConfidence",
  //     iptStep: "0.01",
  //     sldStep: "0.001",
  //     dftValue: "0.254",
  //   },
  //   iptSldOverlap: {
  //     iptText: "Overlap",
  //     iptId: "iptOverlap",
  //     sldId: "sldOverlap",
  //     iptStep: "0.01",
  //     sldStep: "0.001",
  //     dftValue: "0.7",
  //   },
  // };

